$_MODULE['<{ets_affiliatemarketing}prestashop>defines_c0f51f6357d49bd2dea780ae385faa41'] = 'Nehmen Sie an unserem Treueprogramm teil, um Produkte zu günstigeren Preisen zu kaufen. Dieses Programm ist nicht für alle Kunden öffentlich, bitte reichen Sie einen Antrag mit zusätzlichen Informationen über Sie ein. Unser Moderatorenteam prüft Ihre Bewerbung, um zu entscheiden, ob Sie zur Teilnahme an dem Programm berechtigt sind.';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_0acabae8938aacc9edb3deae260d6cbb'] = 'Diese Nachricht wird auf der Registrierungsseite des Programms angezeigt. Lassen Sie das Feld leer, um diese Nachricht nicht anzuzeigen';
