$_MODULE['<{ets_affiliatemarketing}prestashop>defines_8e998ada84a78090b597d8f630760b05'] = 'Sie sind NICHT berechtigt, an unserem Treueprogramm teilzunehmen, da Ihr Gesamtbestellwert in der Vergangenheit [total_past_order] den erforderlichen Mindestbetrag [min_order_total] . Bitte kaufen Sie [amount_left] mehr, um sich für das Treueprogramm zu qualifizieren.';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_f02a6e55d695602047213e1612089f9d'] = 'Verfügbare Daten-Tags: [highlight] [total_past_order] [end_highlight] , [highlight] [min_order_total] [end_highlight] , [highlight] [amount_left] [end_highlight] . Lassen Sie dieses Feld leer, um die Registerkarte „Treueprogramm“ auf der Seite „Mein Konto“ auszublenden, wenn die Mindestgesamtbestellung den erforderlichen Betrag nicht erreicht';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_5386484801d01d2ece73fbc5f605f739'] = 'Email Einstellungen';
