$_MODULE['<{ets_affiliatemarketing}prestashop>defines_e70bc32152b871e53bb5d0015bf013a3'] = 'Dieses Programm ermöglicht es Kunden, Sponsoren Ihrer Website zu werden. Sie können Belohnungen verdienen, wenn ihre Freunde ein KONTO ERSTELLEN oder wenn ihre Freunde PRODUKTE auf der Website KAUFEN';
