$_MODULE['<{ets_affiliatemarketing}prestashop>defines_96d64eecdb6a0cb555fa088f1daa7f01'] = 'Fordern Sie den Kunden auf, einen Antrag auf Teilnahme am Empfehlungs-/Sponsoring-Programm einzureichen';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_9099dae88a59c0caab4ec694ba4def0f'] = 'Diese Option stellt sicher, dass nur Kunden, die wirklich an dem Empfehlungs-/Sponsoring-Programm interessiert sind, Sponsor für Ihre Website werden. Sie (Administrator) müssen die Anträge manuell genehmigen, damit der Kunde am Empfehlungs-/Sponsoring-Programm teilnehmen kann';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_4c12b77da21824c1c972576bb1469560'] = 'Mindestbestellwert erforderlich, um Sponsor zu werden';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_f9f729f415aa9e3c148144043fee8bf1'] = 'Berechnet anhand der Gesamtkosten aller vergangenen Bestellungen. Damit stellen Sie sicher, dass Sie nur Qualitätskunden erlauben, Sponsor zu werden. Lassen Sie das Feld leer, damit alle Kunden aus ausgewählten Gruppen Sponsor werden können';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_f351841eba17000f9b7aa3daf18ebdbb'] = 'Maximale Anzahl an Freunden kann gesponsert werden';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_059976bb8f6ef8f3d9076dc25f57ea03'] = 'Dies hilft, die Breite des mehrstufigen Marketingbaums zu begrenzen, indem sichergestellt wird, dass ein Sponsor nur eine begrenzte Anzahl von gezielt gesponserten Freunden haben kann. Lassen Sie das Feld leer, wenn Sie die Anzahl der Freunde, die ein Sponsor auf Ihre Website verweisen kann, nicht begrenzen möchten';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_9f8dd127e351c5ae29b5d68eda00ec7c'] = 'Sponsoren erlauben, ihre Freunde per E-Mail einzuladen';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_bc36fe26642ab187ef92d29332286bd3'] = 'Diese Option ermöglicht es dem Sponsor, die E-Mail-Adresse und den Namen seines Freundes in ein Einladungsformular im Front Office einzugeben, um Einladungen an die Freunde zu senden und sie zu ermutigen, ein neues Konto auf der Website zu erstellen.';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_5ae51e2c3bcc942d9db85d1f43d12713'] = 'Maximale Anzahl an Einladungen';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_d0be1a60f4b42fcd8bf5167e3081320c'] = 'Maximale Anzahl an Einladungen, die der Sponsor per E-Mail an seine Freunde senden kann. Lassen Sie das Feld leer, um die Anzahl der Einladungen nicht zu begrenzen';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_33b0e42a8718a050601c7a9cf7d86f91'] = 'Geben Sie dem Sponsor eine Belohnung, wenn seine Freunde ein neues Konto registrieren';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_27b1af0157db2060be9473dd46e1e474'] = 'Dies soll Kunden ermutigen, ihre Freunde einzuladen, ein neues Konto auf der Website zu erstellen';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_e7fd16ff7d49427af5a0ab8af57942fc'] = 'Wie belohne ich, wenn neue Konten generiert werden? (Laden Sie Freunde ein, ein Konto zu erstellen, um eine Belohnung zu erhalten)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_78c95899d44068a8aa3fab5f84e97fbf'] = 'Wie viel zahlen Sie für jede neue Registrierung?';
