$_MODULE['<{ets_affiliatemarketing}prestashop>defines_9979f246f398a9ae274f852d6e4da4e1'] = 'Lassen Sie das Feld leer, wenn Sie für alle neuen Konten bezahlen möchten, die von einem Sponsor generiert wurden';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_f9830bacc3635e1a3372191da57ea9ea'] = 'Geben Sie dem Sponsor nur eine Belohnung, wenn sein Freund die erste Bestellung abschließt (er hat für die erste Bestellung bezahlt)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_93eae531fdc704d701e6774a91bfeb47'] = 'Dadurch soll sichergestellt werden, dass das neue Konto REAL ist und nur bezahlt wird, wenn der neue Benutzer etwas auf der Website gekauft hat.';
