$_MODULE['<{ets_affiliatemarketing}prestashop>defines_d0a8bb0dc755030bcdb7a6d7841aa1a4'] = 'Wie belohne ich, wenn neue Bestellungen generiert werden? (Multi-Level-Marketing - Verdienen Sie Belohnungen für Bestellungen von gesponserten Freunden)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_e41c3d27e5f00685e5c8d592d762ee12'] = 'Auf diese Weise können Sponsoren Belohnungen verdienen, wenn ihre gesponserten Freunde Produkte kaufen. Multi-Level-Marketing unterstützen (Sponsoren können auch Belohnungen verdienen, wenn Kunden aus allen niedrigeren Ebenen Produkte kaufen)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_a07a007d26416180aaa9bb8dd4e50a46'] = 'Belohnung nur auf Bestellungen von geben';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_b0e8be6a37f1a40900b3efc60f19f23a'] = 'erste neue Freunde';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_d015964931b30fb9ab1699941561f531'] = 'Dies dient dazu, die Anzahl der Bestellungen zu begrenzen, die Sponsoren Prämien erhalten, indem die Anzahl der direkt gesponserten Freunde begrenzt wird, für die Sponsoren Prämien für ihre Bestellungen erhalten können. Wenn eine Bestellung von einem Kunden aufgegeben wird, der dieses Limit überschreitet, erhalten alle Sponsoren (jedes Level) keine Belohnung. Lassen Sie das Feld leer, wenn Sie Sponsoren belohnen möchten, wenn Freunde, die sie gesponsert haben, Produkte in Ihrem Shop kaufen';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_ba1053f5c3549e600c5213852b6ef6c0'] = 'Geben Sie nur eine Belohnung für';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_a65fa179670e172d23e38f0926078b5e'] = 'erste Bestellungen von jedem Freund';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_84aebb7d0db493ae8150eb880aa48f36'] = 'Dies dient dazu, die Anzahl der Bestellungen zu begrenzen, die Sponsoren Belohnungen erhalten, indem die Anzahl der Bestellungen begrenzt wird, um Belohnungen an Sponsoren (alle Ebenen) jedes Freundes zu vergeben. Lassen Sie das Feld leer, wenn Sie den Sponsor für alle Bestellungen seiner Freunde belohnen möchten';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_9d1cdef34c895721ee018d787ebe77e2'] = 'Mindestbestellmenge des Sponsor-Freundes erforderlich, um eine Belohnung zu erhalten';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_77bb6510c2972147d51db097c8ebfb9d'] = 'Bewerben Sie sich für die Bestellung des Sponsors Freund. Dies soll sicherstellen, dass Sie mehr Geld verdienen als die Belohnung, die Sie geben. Lassen Sie das Feld leer, um die Belohnung für einen beliebigen Bestellbetrag ihres Freundes zu sponsern';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_fc111eb9b9d65fbe3867a2a6fa32a029'] = 'Wie berechnet man die Belohnung für den Sponsor, wenn seine Freunde Produkte kaufen?';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_c2484ee58d1c96320ecc5daab35a430a'] = 'Prozentsatz der Gesamtkosten der Bestellung (ohne Versand)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_e59c4e82583c7b775c4e2d5cf81954a6'] = 'Festbetrag pro Bestellung';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_f46df60ff3ce8f5fbc6cab767c6e1a77'] = 'Sponsorenkosten (nach Auftragsprozentsatz)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_610b3dd29e29d18ad3452268fafc9340'] = '% der Gesamtkosten der Bestellung';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_19ba7d945f7bf95867cde5e6ece03c60'] = 'Dies ist der maximale Gesamtbetrag, den Sie für das Sponsoring-System bezahlen möchten, wenn eine Bestellung generiert wird, berechnet als Prozentsatz basierend auf den Gesamtkosten der Bestellung. Dies soll sicherstellen, dass Sie nicht so viele Marketingkosten bezahlen, wenn eine Bestellung durch das Sponsoring-System generiert wird. Wie viel würden Sie Sponsoren insgesamt für jede Bestellung ihres Freundes zahlen wollen? Wenn Sie dieses Feld leer lassen, werden alle Sponsoren nicht mehr belohnt, wenn eine neue Bestellung generiert wird.';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_826978b762ea6f023206a4f4ed7971ed'] = 'Sponsorkosten (fester Betrag)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_3fd02012ffcc7fcc913610e80ba41f31'] = 'Dies ist der maximale Gesamtbetrag, den Sie für das Sponsoring-System bezahlen möchten, wenn eine Bestellung generiert wird. Dies soll sicherstellen, dass Sie nicht so viele Marketingkosten zahlen, wenn eine Bestellung durch das Sponsoring-System generiert wird. Wie viel würden Sie den Sponsoren insgesamt für jede Bestellung ihres Freundes zahlen wollen?';
