$_MODULE['<{ets_affiliatemarketing}prestashop>defines_6596779bff505778beeb0c79832395d9'] = 'Lassen Sie das Feld leer, wenn Sie keine Belohnung für niedrigere Stufen vergeben möchten. Lassen Sie dieses Feld leer, um die Tiefe des mehrstufigen Marketingbaums zu begrenzen, indem nicht alle Sponsorenstufen belohnt werden';
